var itIT={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'Un errore di Metamask ha causato la disconnessione del tuo portafoglio. Ricarica la pagina per riconnetterti.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"È necessaria una firma per scambiare questo token sul protocollo Uniswap. Per sicurezza, le firme scadono dopo 30 giorni.","Allow":"Consenti","Allow in your wallet":"Consenti nel tuo portafoglio","Allow {symbol} first":["Consenti prima ",["symbol"]],"Allowance pending":"Concessione in attesa","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Si è verificato un errore durante il tentativo di eseguire questo scambio. Potrebbe essere necessario aumentare la tolleranza allo slittamento. Se ciò non funziona, potrebbe esserci un'incompatibilità con il token che stai scambiando. Nota: la commissione sui token di trasferimento e rebase non è compatibile con Uniswap V3.","Approval pending":"In attesa di approvazione","Approve":"Approva","Approve Permit2":"Approva Permit2","Approve in your wallet":"Approva nel tuo portafoglio","Approve {0} for trading":["Approva ",["0"]," per il trading"],"Approve {symbol} first":["Approva prima ",["symbol"]],"Auto":"Automatico","Auto Router":"Router automatico","Auto Router API":"Auto Router API","Balance:":"Saldo:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Il percorso con il miglior prezzo costa ",["0"]," in gas. Il tuo prezzo è ottimizzato considerando rotte divise, salti multipli e costi del gas."],"Cancel":"Cancella","Close":"Chiudi","Confirm in your wallet":"Conferma nel tuo portafoglio","Confirming approval":"Confermando l'approvazione","Connect to {0}":["Connesso a ",["0"]],"Connect wallet":"Collega portafoglio","Connecting…":"Collegando…","Continue":"Continua","Convert {0} to {1}":["Converti ",["0"]," in ",["1"]],"Convert {0} to {1} with no slippage":["Converti ",["0"]," in ",["1"]," senza slippage"],"Disconnect wallet":"Scollega il portafoglio","Dismiss":"Ignora","Enter an amount":"Inserisci un importo","Error fetching trade":"Errore durante il recupero dell'operazione","Exchange rate":"Tasso di cambio","Expected output":"Output previsto","Fetching best price…":"Recuperando il prezzo migliore…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Ti dà la possibilità di scambiare questo token sul protocollo Uniswap. Per motivi di sicurezza, scadrà tra 30 giorni.","High slippage increases the risk of price movement":"Un elevato slippage aumenta il rischio di oscillazione dei prezzi","I don't have a wallet":"Non ho un portafoglio","Insufficient liquidity":"Liquidità insufficiente","Insufficient {0} balance":["Saldo ",["0"]," insufficiente"],"Invalid recipient":"Destinatario non valido","Max":"Max","Max slippage":"Massimo slittamento","Maximum input after slippage":"Massimo input dopo lo slippage","Minimum output after slippage":"Minimo input dopo lo slippage","Missing dependencies":"Dipendenze mancanti","Network fee":"Tariffa di rete","No results found.":"Nessun risultato trovato.","No tokens are available on this network. Please switch to another network.":"Nessun token è disponibile su questa rete. Si prega di passare a un'altra rete.","Order routing":"Rotta dell'ordine","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["L'output è una stimata. Riceverai almeno ",["minReceivedString"]," o la transazione verrà annullata."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["L'output è una stima. Invierai al massimo ",["maxSentString"]," o la transazione verrà annullata."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 consente la condivisione e la gestione sicure delle approvazioni dei token tra diversi contratti intelligenti.","Permit2 approval failed":"Approvazione Permit2 fallita","Please enter a valid slippage %":"Si prega di inserire uno slippage % valido","Powered by the Uniswap protocol":"Alimentato dal protocollo Uniswap","Price impact":"Impatto sui prezzi","Price updated":"Prezzo aggiornato","Reload":"Ricarica","Reload the page":"Ricarica la pagina","Request rejected":"Richiesta respinta","Review swap":"Scambio di recensioni","Search by token name or address":"Cerca per nome o indirizzo del token","Select token":"Select token","Show less":"Mostra meno","Show more":"Show more","Something went wrong":"Qualcosa è andato storto","Sorry, an error occured while processing your request. Please try again or contact support.":"Siamo spiacenti, si è verificato un errore durante l'elaborazione della tua richiesta. Riprova o contatta l'assistenza.","Success":"Successo","Swap":"Scambia","Swap failed: {0}":["Scambio fallito: ",["0"]],"Switch network":"Cambia rete","Switch network in your wallet":"Cambia rete nel tuo portafoglio","Switching network":"Cambio di rete","Test Title":"Titolo Test","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"L'invariante Uniswap x * y = k non è stata soddisfatta con lo scambio. Questo di solito significa che uno dei token che stai scambiando incorpora un comportamento personalizzato durante il trasferimento.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"Il token di input non può essere trasferito. Potrebbe esserci un problema con il token di input.","The network is confirming your Permit2 approval before you can swap.":"La rete sta confermando la tua approvazione di Permit2 prima che tu possa scambiare.","The output token cannot be transferred. There may be an issue with the output token.":"Il token di output non può essere trasferito. Potrebbe esserci un problema con il token di output.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Il token di output non può essere trasferito. Potrebbe esserci un problema con il token di output. Nota: la commissione sui token di trasferimento e rebase non è compatibile con Uniswap V3.","There will be a large difference between your input and output values due to current liquidity.":"Ci sarà una grande differenza tra i valori di input e output a causa della liquidità attuale.","This error was prompted by denying a request in your wallet.":"Questo errore è stato generato rifiutando una richiesta nel tuo portafoglio.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"Questa transazione non può essere inviata perché il termine è scaduto. Verifica che la scadenza della tua transazione non sia troppo bassa.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Questa transazione non avrà esito positivo a causa del movimento dei prezzi. Prova ad aumentare la tua tolleranza allo slittamento. Nota: la commissione sui token di trasferimento e rebase non è compatibile con Uniswap V3.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Questa transazione non avrà esito positivo a causa del movimento del prezzo o della commissione sul trasferimento. Prova ad aumentare la tua tolleranza allo slittamento.","This transaction will result in a":"Questa transazione si tradurrà in un","Transaction deadline":"Termine transazione","Transaction rejected":"Transazione rifiutata","Transaction submitted":"Transazione inviata","Try again":"Riprova","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Prova ad aumentare la tua tolleranza allo slippage.<0/>NOTA: le commissioni sui token di trasferimento e rebase non sono compatibili con Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"Errore inaspettato. Impossibile stimare il gas per lo scambio.","Unexpected issue with estimating the gas. Please try again.":"Problema imprevisto con la stima del gas. Per favore riprova.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Visualizza su Etherscan","Wallet disconnected":"Wallet disconnesso","Warning":"Avvertimento","You pay":"Tu paghi","You receive":"Tu ricevi","Your swap failed.":"Lo swap non è riuscito.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"La transazione verrà ripristinata se è rimasta in sospeso per più di questo periodo di tempo.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"La transazione verrà ripristinata se il prezzo cambia sfavorevolmente di più di questa percentuale.","minutes":"minuti","price impact on the market price of this pool. Do you wish to continue?":"impatto del prezzo sul prezzo di mercato di questa pool. Vuoi continuare?","{0} approval failed":[["0"]," approvazione fallita"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," canone"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

